import React from 'react';

class Product extends React.Component {

  render() {
    return (
      <div className="product">
        <div className="p-content">
          {/* 图片 */}
          <div className="img-wrapper">
            <figure className="image is-4by3">
              <img src="" alt=""/>
            </figure>
          </div>
        </div>
        <p>Product</p>
      </div>
    )
  }
}

export default Product;
